class MoviesModel{

    public movieId:number;
    public theaterId:number;
    public genreId:number;
    public name:string;
    public time:string;
    public length:number;
    public date:string;
    public endDate:string
    public trailer:string;
    public summary:string;
    public image:File;
    public imageName: string;    

}
export default MoviesModel;
